import React, { Component } from 'react';
import BootstrapTable from 'react-bootstrap-table-next';

var selectRowProp = {
  mode: "checkbox",
  clickToSelect: true,
  bgColor: "rgb(238, 193, 213)"
};


export default class Projects extends Component {
  state = {
  }







  render () {
      return (
        <div className="divProj">

          <div id="divUpProj">
            <div id="titleProj">
               <h1>Projects overview</h1>
            </div>
          </div>

          <div id="divDownProj">
            <div id="projTable">
            <BootstrapTable
              data={products}
              selectRow={selectRowProp}
              striped
              hover
              condensed
              pagination
              insertRow
              deleteRow
              search
            >
              <TableHeaderColumn dataField="id" isKey dataAlign="right" dataSort>Product ID</TableHeaderColumn>
              <TableHeaderColumn dataField="name" dataSort>Product Name</TableHeaderColumn>
              <TableHeaderColumn dataField="price" dataAlign="center" >Product Price</TableHeaderColumn>
            </BootstrapTable>
            </div>
          </div>

        </div>
      )
   }

}
